pragma solidity ^0.5.16;
pragma experimental ABIEncoderV2;

import "./GeneralStorage.sol";

contract FactoryInfo  {
    GeneralStorage generalStorage;

    function setStorageAddress(address _addr) public{
        generalStorage = GeneralStorage(_addr);
    }

    function setInFactory(bytes memory _id,bytes memory _date,
                            bytes memory _cert,bytes memory _lvl,bytes memory _hash,bytes memory _weight) public{
        string memory inFactoryTime = "inFactoryTime";
        string memory carCert = "carCert";
        string memory level = "level";
        string memory inPicHash = "inPicHash";
        string memory inWeight = "inWeight";
        generalStorage.setStorage(_id,bytes(inFactoryTime),_date);
        generalStorage.setStorage(_id,bytes(carCert),_cert);
        generalStorage.setStorage(_id,bytes(level),_lvl);
        generalStorage.setStorage(_id,bytes(inPicHash),_hash);
        generalStorage.setStorage(_id,bytes(inWeight),_weight);
    }

    function setOutFactory(bytes memory _id,bytes memory _date,bytes memory _hash,bytes memory _weight) public{
        string memory outFactoryTime = "outFactoryTime";
        string memory outPicHash = "outPicHash";
        string memory outWeight = "outWeight";
        generalStorage.setStorage(_id,bytes(outFactoryTime),_date);
        generalStorage.setStorage(_id,bytes(outPicHash),_hash);
        generalStorage.setStorage(_id,bytes(outWeight),_weight);
    }

    function getInfo(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){

        bytes[] memory stages = new bytes[](8);
        bytes[] memory values = new bytes[](8);
        string[8] memory list = ["inFactoryTime","carCert","level","inPicHash","inWeight","outFactoryTime","outPicHash","outWeight"];

        for (uint i = 0; i < 8; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }
}
